import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
      <div className="img">
      <img src="https://wwwcms.ncyu.edu.tw/images/logo.png"/>
      </div>
    <App />
  </React.StrictMode>
);
